INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3605, 29284, 'Boceprevir', 'Food significantly enhances the oral bioavailability of boceprevir.  When given at 800 mg three times daily with food, boceprevir exposure increased by up to 65% relative to administration in the fasting state.  The bioavailability of boceprevir was similar regardless of meal type (e.g., high-fat versus low-fat) or whether taken 5 minutes prior to eating, during a meal, or immediately following completion of the meal.  Therefore, boceprevir may be taken without regard to either meal type or timing of the meal.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c1dcbd10d80200c05c055de00c6695ca048238dd09216d4f135fedcdf6d06d698ce68f448a30af30f4a61de87982e48b67377bec411c566cd480cca4d5462b073c62da380d0f8efa872948150dacff505d150238d', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3606, 5164, 'Bortezomib', 'Data from in vitro and animal (mice) studies suggest that green tea may antagonize the cytotoxic effects of bortezomib.  Polyphenols in green tea such as (-)-epigallocatechin gallate (EGCG) have been shown to block the proteasome inhibitory action of bortezomib in multiple myeloma and glioblastoma cancer cell lines.  The mechanism appears to involve a direct chemical reaction between the boronic acid moiety of bortezomib and the 1,2-benzenediol groups present in certain polyphenols leading to inactivation of bortezomib.', 'green tea', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3607, 15448, 'Bortezomib', 'Data from in vitro and animal (mice) studies suggest that green tea may antagonize the cytotoxic effects of bortezomib.  Polyphenols in green tea such as (-)-epigallocatechin gallate (EGCG) have been shown to block the proteasome inhibitory action of bortezomib in multiple myeloma and glioblastoma cancer cell lines.  The mechanism appears to involve a direct chemical reaction between the boronic acid moiety of bortezomib and the 1,2-benzenediol groups present in certain polyphenols leading to inactivation of bortezomib.', 'green tea', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
